import React, {Component } from "react";
import Request from "../helpers/requests.js"

class EditBookingComponent extends Component {
  constructor(props) {
    super(props)
    this.state = {
      currentBooking: null,
      date: null,
      time: null
    }
}

  componentWillMount() {

        console.log(this.props.allBookings)

  }

  handleDateChange(event) {
    this.setState({date: event.target.value})
  }

  handleTimeChange(event) {
    this.setState({time: event.target.value})
  }

  render() {
    return (<div>
      <form onSubmit={this.handleSubmit}>
        Date <input type="text" onChange={this.handleDateChange} />
        Time <input type="text" onChange={this.handleTimeChange} />
        Search <input type="submit" />
      </form>
    </div>)
  }
}


export default EditBookingComponent;
